    [],nt"revision_timestamp": "2015-09-27T00:12:14.426944",nt"name": "nodc-standard-product-experimental-compact-disk-nodc-01-pacific-ocean-temperature-salinity-prof",nt"isopen":
    false,nt"url": null,nt"notes": "The National Oceanographic Data Center
    (NODC) created a compact disk containing over 1.3 million temperature-depth and
    salinity-depth profiles taken in the Pacific Ocean between 1900 and 1988. Designated
    as CD-ROM NODC-01, it was the first in a planned series of ocean data compact disks
    holding major portions of NODC's global data archive. CD-ROM NODC-01 was made available
    free to researchers who agreed to test it and provide an evaluation of the disc
    to the NODC. NODC-01 was subsequently replaced with later CD-ROM products holding
    additional observation data. The NODC World Ocean Database collections accessible
    via CD-ROM, DVD-ROM and online services contain the most recent version of these
    temperature and salinity profile data.",nt"license_title": null,nt"extras":
